import React from "react";
import { Provider } from "react-redux";
import store from "./store";
import HeaderComponent from "./compenents/header";

function App() {
  return (
    <Provider store={store}>
        <div className="table w-full h-full table-fixed divide-gray-100">
          <div className="font-bold text-center text-[23px] text-lime-300 divide-white">
            <HeaderComponent />
          </div>
          <div className="p-2 w-full table-row">
            <div className="max-w-screen-md ml-auto mr-auto h-full">
              컨텐츠 컴포넌트 들어갈 공간
            </div>
          </div>
          <div>
            <div>푸터 컴포넌트 들어갈 공간</div>
          </div>
        </div>
    </Provider>
  );
}

export default App;
